import React from 'react'
import './clusterMessage.component.scss'
import Button from '../button/button.component'
import { motion } from "framer-motion"

const container = {
    initial: { opacity: 0 },
    actual: { 
        opacity: 1,
        transition: {
            when: "beforeChildren",
            staggerChildren: 0.3
        }
    }
}

const item = {
    initial: { opacity: 0, y: 100 },
    actual: { opacity: 1, y: 0 }
}

export default function ClusterMessage(props) {

    return (
        <motion.div className="cluster-message" style={props.style}  initial="initial" animate="actual" variants={container}>
            <motion.h1 variants={item}>materiale de contructii, gradinarit & bricolaj</motion.h1>
            <motion.p variants={item}>Nu ai gasit ce cautai?</motion.p>
            <motion.p variants={item}>Preluam si comenzi speciale</motion.p>
            <motion.p variants={item}>Apeleaza-ne la 0732 409 095</motion.p>
            <Button/>
        </motion.div>
    )
}
